import React, { useEffect, useState, useRef } from "react";
import {
    ChartCanvas,
    Chart,
    XAxis,
    YAxis,
    CandlestickSeries,
    LineSeries,
    CurrentCoordinate,
    EdgeIndicator,
    MouseCoordinateX,
    MouseCoordinateY,
} from "react-financial-charts";
import { scaleTime } from "d3-scale";
import { timeFormat } from "d3-time-format";
import "./CandlestickChart.css";

const CandlestickChart = ({ ticker, entryPoint, exitPoint, additionalData }) => {
    const [chartData, setChartData] = useState([]);
    const [error, setError] = useState(null);
    const [containerSize, setContainerSize] = useState({ width: 700, height: 400 });
    const containerRef = useRef(null);

    useEffect(() => {
        const fetchChartData = async () => {
            try {
                const response = await fetch(
                    `http://localhost:5000/api/candlestick?ticker=${ticker}`
                );
                const data = await response.json();
                if (response.ok && data.dates) {
                    const formattedData = data.dates
                        .map((date, index) => {
                            if (
                                date &&
                                data.open[index] !== null &&
                                data.high[index] !== null &&
                                data.low[index] !== null &&
                                data.close[index] !== null
                            ) {
                                return {
                                    date: new Date(date),
                                    open: data.open[index],
                                    high: data.high[index],
                                    low: data.low[index],
                                    close: data.close[index],
                                };
                            }
                            return null; // Exclude invalid data
                        })
                        .filter((entry) => entry !== null); // Remove null entries
                    setChartData(formattedData);
                } else {
                    setError(data.error || "Invalid chart data received from API.");
                }
            } catch (err) {
                setError("Failed to fetch chart data.");
                console.error(err);
            }
        };

        fetchChartData();
    }, [ticker]);

    useEffect(() => {
        const updateContainerSize = () => {
            if (containerRef.current) {
                setContainerSize({
                    width: containerRef.current.offsetWidth,
                    height: containerRef.current.offsetHeight,
                });
            }
        };

        updateContainerSize();
        window.addEventListener("resize", updateContainerSize);
        return () => window.removeEventListener("resize", updateContainerSize);
    }, []);

    if (error) {
        return <p style={{ color: "red" }}>{error}</p>;
    }

    if (chartData.length === 0) {
        return <p>Loading chart...</p>;
    }

    const margin = { left: 60, right: 60, top: 20, bottom: 50 };

    return (
        <div className="chart-container" ref={containerRef}>
            <h3 className="chart-title">{ticker}</h3>
            <div className="chart-canvas">
                <ChartCanvas
                    data={chartData}
                    width={containerSize.width}
                    height={containerSize.height}
                    ratio={1}
                    margin={margin}
                    xAccessor={(d) => d?.date || new Date()} // Ensure safe access to date
                    xScale={scaleTime()}
                    displayXAccessor={(d) =>
                        d?.date ? timeFormat("%Y-%m-%d")(d.date) : ""
                    }
                    seriesName={ticker}
                >
                    <Chart id={1} yExtents={(d) => [d.high, d.low]}>
                        <XAxis axisAt="bottom" orient="bottom" />
                        <YAxis axisAt="left" orient="left" />

                        <MouseCoordinateX displayFormat={timeFormat("%b %d, %Y")} />
                        <MouseCoordinateY displayFormat={(d) => `$${d.toFixed(2)}`} />

                        <CandlestickSeries />

                        {/* Entry and Exit Lines */}
                        <LineSeries
                            yAccessor={() => entryPoint}
                            stroke="green"
                            strokeDasharray="5 5"
                            highlightOnHover
                        />
                        <LineSeries
                            yAccessor={() => exitPoint}
                            stroke="red"
                            strokeDasharray="5 5"
                            highlightOnHover
                        />

                        {/* Current Coordinates */}
                        <CurrentCoordinate
                            yAccessor={() => entryPoint}
                            fill="green"
                        />
                        <CurrentCoordinate
                            yAccessor={() => exitPoint}
                            fill="red"
                        />

                        {/* Edge Indicators */}
                        <EdgeIndicator
                            itemType="last"
                            orient="right"
                            edgeAt="right"
                            yAccessor={(d) => d.close}
                        />
                    </Chart>
                </ChartCanvas>
            </div>
            <div className="chart-info">
                <p>{additionalData}</p>
                <p>
                    <strong>Entry Point:</strong> ${entryPoint.toFixed(2)} <br />
                    <strong>Exit Point:</strong> ${exitPoint.toFixed(2)}
                </p>
            </div>
        </div>
    );
};

export default CandlestickChart;
